import { createContext, useState, useContext, useCallback, useMemo } from 'react';

export const NotesContext = createContext({});

export const NotesContextProvider = ({ children }) => {
  const [notes, setNotes] = useState([
    {
      chaper: 1,
      categories: ['test'],
      chapterName: 'text c ğŸ˜…ğŸ˜…ğŸ˜…ğŸ˜…',
      content:
        '<p>This is a test </p><p><br></p><p><img src="data:image/jpeg;base64,"></p>',
      id: '0R1vMis4auvAmJSmHPEe',
      createdAt: '2022-03-20T05:52:50.580Z',
    },
    {
      chaper: 1,
      categories: ['test'],
      chapterName: 'text c',
      content:
        '<p><img src="data:image/png;base64,"></p>',
      id: 'Vj8cTSgkwYyx60QSV6LC',
      createdAt: '2022-03-20T05:55:10.532Z',
    },
  ]);

  const addNote = useCallback(note => setNotes(p => [...p, note]), []);

  const values = useMemo(() => {
    return {
      notes,
      addNote,
    };
  }, [notes]);

  return <NotesContext.Provider value={values}>{children}</NotesContext.Provider>;
};

export const useNotes = () => {
  const context = useContext(NotesContext);
  if (!context) throw new Error('Wrap use Theme inside ThemeContext');
  return context;
};
